package com.Rahul.Medicine2.service;

import com.Rahul.Medicine2.model.BuyMeds;
import org.springframework.stereotype.Service;

import java.util.ArrayList;
import java.util.List;

@Service
public class HomeService {
    public List<BuyMeds> soldMeds()
    {
        List<BuyMeds> buys = new ArrayList();
        BuyMeds buy1 = new BuyMeds(1, "Fever", "data:image/jpeg;base64,", 25);
        BuyMeds buy2 = new BuyMeds(2, "Pain", "data:image/jpeg;base64," , 25);
        buys.add(buy1);
        buys.add(buy2);
        return buys;
    }
    public List<BuyMeds> searchedMeds(String medName)
    {
        List<BuyMeds> buys = new ArrayList();
        BuyMeds buy1 = new BuyMeds(1, medName, "data:image/jpeg;base64,", 25);
        buys.add(buy1);
        return buys;
    }
}
